import React from 'react';
import backgroundPic from '../../../Logo/healthy-diet.jpg'


export default class HomeContainer extends React.Component {
    render(){
        
        return (
            <div style={{position:'absolute',marginTop:'40px',marginLeft:'-220px',width:'100vw'}}>
            <div style={{ backgroundImage:`url(${backgroundPic})`,width:'100vw',height:'700px',backgroundRepeat:'no-repeat',backgroundSize: '100vw'}}>
            </div>
            </div>
        )}
}
